import React from 'react';
import ReactDOM from 'react-dom';

import {App} from './App.js';
import './index.css';

const fname = 'jatin';
const lname = 'mishra';
const today = new Date();
const img = 'https://images.unsplash.com/photo-1615125468484-088e3dfcabb6?ixid=MXwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHw%3D&ixlib=rb-1.2.1&auto=format&fit=crop&w=934&q=80';
const img2 = 'https://images.unsplash.com/photo-1601933973783-43cf8a7d4c5f?ixid=MXwxMjA3fDF8MHxwaG90by1wYWdlfHx8fGVufDB8fHw%3D&ixlib=rb-1.2.1&auto=format&fit=crop&w=1950&q=80';
const img3 = 'https://images.unsplash.com/photo-1615549332616-3922167e33f8?ixid=MXwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHw%3D&ixlib=rb-1.2.1&auto=format&fit=crop&w=934&q=80';
const link = "https://www.jatinmishra.com";


const heading = {
    color: 'red', textTransform:'capitalize', textAlign:'center'
};

ReactDOM.render(
                <>
                <h1 style={heading}> {`${fname} and ${lname}`}</h1>
                <div style={{padding: '0 20px', margin:'0 20px', border:'2px solid black'}} className="img_div">
                <img style={{maxWidth:"90%"}} src={img} alt='ferrari' />
                <img src={img2} alt='mac'/>
                <a href={link} target='_jatin'>
                <img src={img3} alt='snow' />
                </a>
                </div>

                </>
                ,
                document.getElementById('root'));
